PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX syn: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX pl: <http://www.w3.org/1999/02/22-rdf-syntax-ns#PlainLiteral>
SELECT DISTINCT ?most_promising_procedure WHERE {
  ?patient a syn:Patient;
    syn:allergy ?allergy.
  ?allergy a syn:Allergy;
    syn:description "Mold (organism)"^^pl.
  ?patient syn:procedure ?procedure.
  ?procedure a syn:Procedure;
    syn:code ?code.
  # Assuming the most promising procedure is the one associated with the highest base cost
  ?most_promising_procedure a syn:Procedure;
    syn:code ?most_promising_code.
  FILTER(?most_promising_procedure = (
      SELECT DISTINCT ?procedure
      WHERE {
        ?procedure a syn:Procedure.
        ?procedure syn:code ?code.
        ?procedure syn:basecost ?basecost_A.
        {
          SELECT DISTINCT ?procedure
          WHERE {
            ?procedure a syn:Procedure.
            ?procedure syn:code ?code.
            ?procedure syn:basecost ?basecost_B.
            FILTER(?basecost_B > ?basecost_A)
          }
          ORDER BY DESC(?basecost_B)
          LIMIT 1
        }
      }
  ) )
}

