PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX syn: <https://knacc.umbc.edu/dae-young/kim/ontologies/synthea#>
SELECT (COUNT(?success) / COUNT(DISTINCT ?medication) * 100) AS ?successrate WHERE {
  {
    ?medication syn:code "804302"^^rdf:string ;
    syn:description "Simvastatin 10 MG Oral Tablet"^^rdf:string .
    ?patient syn:medication ?medication ;
    syn:healthcareCoverage ?coverage .
    ?coverage syn:amount_covered ?amount_covered .
  }
  UNION
  {
    ?other_medication syn:code "804302"^^rdf:string ;
    syn:description "Simvastatin 10 MG Oral Tablet"^^rdf:string .
    ?patient syn:medication ?other_medication ;
    syn:healthcareCoverage ?other_coverage .
    ?other_coverage syn:amount_covered ?amount_covered .
    FILTER(?amount_covered = 0)
  }
  BIND (COALESCE(?amount_covered, 0) AS ?amount_covered_coalesced)
  FILTER(?amount_covered_coalesced > 0)
  BIND(IF(?amount_covered_coalesced > 0, 1, 0) AS ?success)
}

